function removes(wait_time)
	system.wait(wait_time)
	remove = object.get_all_objects()
		for i = 1, #remove do
			local X = remove[i]
			entity.set_entity_velocity(X, v3())
			entity.delete_entity(X)
		end
	menu.notify("Invalid Objects Have Been Deleted.", "Remover")
end

local function request_model(h, t)
    if not h then 
        return 
    end
    if not streaming.has_model_loaded(h) then
        streaming.request_model(h)
        local time = utils.time_ms() + t
        while not streaming.has_model_loaded(h) and time > utils.time_ms() do
               system.yield(5)
           end
    end
    return streaming.has_model_loaded(h)
end

local function cped(type, hash, coords, dir)
    request_model(hash, 300)
    local X = ped.create_ped(type, hash, coords, dir, true, false)
    streaming.request_model(hash)
    return X
end

local function breaking_news(message)
    local news = graphics.request_scaleform_movie("BREAKING_NEWS")
    for n=0, 400 do
        graphics.begin_scaleform_movie_method(news, "GENERIC")
        graphics.draw_scaleform_movie_fullscreen(news, 255, 255, 255, 255, 0)
        graphics.begin_scaleform_movie_method(news, "SET_DISPLAY_CONFIG")
        graphics.scaleform_movie_method_add_param_int(graphics.get_screen_width())
        graphics.scaleform_movie_method_add_param_int(graphics.get_screen_height())
        graphics.scaleform_movie_method_add_param_int(5)
        graphics.scaleform_movie_method_add_param_int(5)
        graphics.scaleform_movie_method_add_param_int(5)
        graphics.scaleform_movie_method_add_param_int(5)
        graphics.scaleform_movie_method_add_param_bool(true)
        graphics.scaleform_movie_method_add_param_bool(true)
        graphics.scaleform_movie_method_add_param_bool(false)
        graphics.end_scaleform_movie_method(news)
        graphics.begin_scaleform_movie_method(news, "SET_TEXT")
        graphics.scaleform_movie_method_add_param_texture_name_string(message)
        graphics.scaleform_movie_method_add_param_texture_name_string("Crash Process")
        graphics.end_scaleform_movie_method(news)
        graphics.begin_scaleform_movie_method(news, "SET_SCROLL_TEXT")
        graphics.scaleform_movie_method_add_param_int(1)
        graphics.scaleform_movie_method_add_param_int(1)
        graphics.scaleform_movie_method_add_param_texture_name_string(message)
        graphics.end_scaleform_movie_method(news)
        graphics.begin_scaleform_movie_method(news, "DISPLAY_SCROLL_TEXT")
        graphics.scaleform_movie_method_add_param_int(1)
        graphics.scaleform_movie_method_add_param_int(1)
        graphics.scaleform_movie_method_add_param_float(10.0)
        graphics.end_scaleform_movie_method(news)
        graphics.begin_scaleform_movie_method(news, "getTicker")
        graphics.scaleform_movie_method_add_param_int(1)
        graphics.end_scaleform_movie_method(news)
        system.wait()
    end
end
