local Anti_Crash_Camera = s.af("Anti Crash Camera", "toggle", misc, function(a)
    location = player.get_player_coords(player.player_id())
    menu.notify("Anti Crash Camera Has Been Enabled.", "Anti Crash Camera")
    entity.set_entity_coords_no_offset(player.get_player_ped(player.player_id()), v3(-2180, -5197, 10000))
    system.yield(10)
    while a.on do
      entity.set_entity_coords_no_offset(player.get_player_ped(player.player_id()), v3(2180, -5197, 10800))
