        entity.set_entity_alpha(clone, 200, true)
        entity.freeze_entity(clone, true)
        if player.is_player_in_any_vehicle(player.player_id()) ~= true then
            native.call(0xEA1C610A04DB6BBB, player.get_player_ped(player.player_id()), false, 0)
            while feat.on do
                native.call(0xEA1C610A04DB6BBB, player.get_player_ped(player.player_id()), false, 0)
                entity.set_entity_coords_no_offset(clone, player.get_player_coords(player.player_id()))
                ped.clear_ped_tasks_immediately(clone)
                entity.set_entity_rotation(clone, entity.get_entity_rotation(clone) + (0.7))
                system.yield()
            end
        end
    end
    if feat.on == false then
        entity.delete_entity(clone)
        native.call(0xEA1C610A04DB6BBB, player.get_player_ped(player.player_id()), true, 0)
    end
end)

