local all_modder_on = false
mark=s.af("Mark All As Modder", "toggle", misc, function(feat)
    if all_modder_on == false then
      local my_pid = player.player_id()
      d= player.add_modder_flag("Skeet")
      for pid = 0, 32 do
        if pid ~= my_pid then
          player.set_player_as_modder(pid, d)
        end
      end
      mapam = event.add_event_listener("player_join", function(i)
        player.set_player_as_modder(i.player, player.add_modder_flag("Skeet"))
      end)
      all_modder_on = true
    end
    if feat.on == false then
      event.remove_event_listener("player_join", mapam)
      all_modder_on = false
      for pid = 0, 32 do
        if pid ~= my_pid then
          player.unset_player_as_modder(pid, d)
        end
      end
    end
end)

s.af("Entity remover", "action", misc, function(feat)
    all_ped = ped.get_all_peds()
    for i = 1, #all_ped do
        if all_ped[i] ~= player.get_player_ped(player.player_id()) then
            entity.delete_entity(all_ped[i])
        end
    end
    system.yield()
    all_vehicle = vehicle.get_all_vehicles()
    for i = 1, #all_vehicle do
        if all_vehicle[i] ~= player.get_player_vehicle(player.player_id()) then
            entity.delete_entity(all_vehicle[i])
        end
    end
    system.yield()
    all_obj = object.get_all_objects()
    for i = 1, #all_obj do
        entity.delete_entity(all_obj[i])
    end
    menu.notify("Finished", "Entity Remover")
end)

component_crash=menu.add_feature("Invalid Component Crash", "action", session_crash, function(creating)
    local model_hash = player.get_player_model(player.player_id())
	local outfit_component_table = {}
	local outfit_component_texture_table = {}
	local outfit_prop_table = {}
	local outfit_prop_texture_table = {}
	for i = 0, 11 do
		outfit_component_table[i] = ped.get_ped_drawable_variation(player.get_player_ped(player.player_id()), i)
		outfit_component_texture_table[i] = ped.get_ped_texture_variation(player.get_player_ped(player.player_id()), i)
	end
	for i = 0, 2 do
		outfit_prop_table[i] = ped.get_ped_prop_index(player.get_player_ped(player.player_id()), i)
		outfit_prop_texture_table[i] = ped.get_ped_prop_texture_index(player.get_player_ped(player.player_id()), i)
	end
    local time = utils.time_ms() + 10000
    while time > utils.time_ms() do
        system.yield(10)

        ped.set_ped_component_variation(player.get_player_ped(player.player_id()), 11, 69, math.random(0, 50), 0)
        
    end
    system.wait(500)
    player.set_player_model(model_hash)
    ped.set_ped_component_variation(player.get_player_ped(player.player_id()), 4, 0, 0, 2)
    system.wait(100)
	for i = 0, 11 do
		ped.set_ped_component_variation(player.get_player_ped(player.player_id()), i, outfit_component_table[i], outfit_component_texture_table[i], 0)
	end
	for i = 0, 2 do
		ped.set_ped_prop_index(player.get_player_ped(player.player_id()), i, outfit_prop_table[i], outfit_prop_texture_table[i], 0)
	end
    menu.notify("Finished", "Invalid Head Blend Crash")
end)

