function dec_to_ipv4(ip)
    return string.format("%i.%i.%i.%i", ip >> 24 & 255, ip >> 16 & 255, ip >> 8 & 255, ip & 255)
end
s.apf("VPN Check", "action_value_str", 0, function(f, pid)
    if f.value == 0 then
    pIp = dec_to_ipv4(player.get_player_ip(pid))
    statusCode, response = web.get("https://proxycheck.io/v2/"..pIp.."?vpn=1")
    if response ~= nil then
        if response:find('"proxy": "no"') then
            menu.notify(""..player.get_player_name(pid).." is not using VPN.", "VPN Checker")
        elseif response:find('"proxy": "yes"') then
            if response:find('name') then
                menu.notify(''..player.get_player_name(pid)..' seems to be using VPN.\n\nVPN Model: '..response:match("\"name\":%s+\"([^\"]+)\","), "VPN Checker")
            else
                menu.notify(''..player.get_player_name(pid)..' seems to be using VPN.\n\nVPN Model: Unknown', "VPN Checker")
            end
        end
    end
elseif f.value == 1 then
    statusCode, response = web.get("http://ip-api.com/json/"..pIp.."?fields=147456")
    if response:find("success") then
        if response:find("true") then
            menu.notify(''..player.get_player_name(pid)..' seems to be using VPN.\n\nVPN Model: '..(str or "Unknown"), "VPN Checker")
        elseif response:find("false") then
            menu.notify(""..player.get_player_name(pid).." is not using VPN.", "VPN Checker")
        end
    elseif response:find("fail") then
        menu.notify("Invalid IP Address", "VPN Checker")
    elseif statusCode == "429" then
        menu.notify("Reached maximum limit for today", "VPN Checker")
    end
end
end)
:set_str_data(
    {
        "ProxyCheck",
        "Ip-Api"
    }
)


